import "../src/App.css"

function App() {
  return (
  <>
    <div id="main-title">Drugi projekt - sigurnost</div>
    <div id="first-div">
      <div id="first-title">
        SQL umetanje (SQL Injection)
      </div>
    </div>
    <div id="second-div">
      <div id="second-title">
        Lažiranje zahtjeva na drugom sjedištu (Cross Site Request Forgery, CSRF)
      </div>
    </div>
  </>
  );
}

export default App;
